import React from "react";
import "../css/Home.css";
import Particles from "react-particles-js";
import { ElfsightWidget } from "react-elfsight-widget";

import picture1 from "../assets/images/silhouette.jpg";
import picture2 from "../assets/images/hondaRepair.jpg";
import Map from "./Map";

const Home = () => {
  return (
    <div className="home">
      <Particles
        className="background"
        params={{
          particles: {
            number: {
              value: 160,
              density: {
                enable: false,
              },
            },
            size: {
              value: 3,
              random: true,
              anim: {
                speed: 4,
                size_min: 0.3,
              },
            },
            line_linked: {
              enable: false,
            },
            move: {
              random: true,
              speed: 1,
              direction: "top",
              out_mode: "out",
            },
          },
          interactivity: {
            events: {
              onhover: {
                enable: true,
                mode: "bubble",
              },
              onclick: {
                enable: true,
                mode: "repulse",
              },
            },
            modes: {
              bubble: {
                distance: 250,
                duration: 2,
                size: 0,
                opacity: 0,
              },
              repulse: {
                distance: 400,
                duration: 4,
              },
            },
          },
        }}
      />
      ;<h1>T-T Honda</h1>
      <p id="">---Since 2004---</p>
      <h4>Full service car repair - specializing in Japanese cars</h4>
      <a href="tel:+16192840050">(619)284-0050</a>{" "}
      <p id="address">4030 43rd Street San Diego, CA 92105</p>
      <div className="imageMapImage">
        <img src={picture1} height="200px" width="100px" alt="car on lift" />;
        <Map />
        <img src={picture2} height="200px" width="100px" alt="honda repair" />
      </div>
      <ElfsightWidget widgetID="71c9190a-bc4a-4da7-a473-567fecb8df58" />
      <p id="slogan">Oil changes to timing belts to Rebuilds!</p>
      <p id="hours">Hours </p>
    </div>
  );
};

export default Home;
